import React from 'react';
import '../App.css';
import './Journey.css';
import {Icon } from 'react-icons-kit';
import {plus} from 'react-icons-kit';


const Journey = () => {
    return(
        <section className="journey__main">
            <div className="journey__container">
                <div className="journey__wrapper">
                    <div className="journey__Cities">
                        <h3 className="journey__Title">Japan</h3>
                        <div className="journey__City">
                            <div className="city_name">Tokyo</div>
                        </div>
                        <div className="journey__City">
                        <div className="city_name">Nagano</div>
                        </div>
                    </div>
                    <div className="journey__Lists">
                    <h3 className="journey__Title">total 1 Day Journey <span><Icon icon={plus}/></span></h3>
                    </div>
                </div>
            </div>
        </section>
    )
}

export default Journey;
